let existsOne (f: 'a->prop) (lst: 'a list) :prop =
        let rec aux p l =
            match l with
            | [] -> And(TT, p)
            | x::xs -> aux (And(negate (f x), p)) xs    

        (FF, lst) ||> List.fold (fun acc element ->
            Or(acc, And(f element, aux TT (lst |> List.except [element])))
        )

